#include <vector>
#include <string>

using namespace std;

class Solution {
public:
    vector<vector<string>> suggestedProducts(vector<string>& products, string searchWord) {
        vector<vector<string>> ra;

        sort(products.begin(), products.end());

        int startpoint = 0;

        for(int i = 0; i < searchWord.size(); i ++){
            vector<string> line{};
            char c = searchWord[i];
            
            int cnt = 0;
            for(int s = startpoint; cnt < 3 && s < products.size(); s++){
                if(products[s][i] == c){
                    line.push_back(products[s]);
                    cnt ++;
                }
            }

            if(cnt == 0) break;

            ra.push_back(line);            
        }

        while(ra.size() < searchWord.size()){
            ra.push_back({});
        }
        
        return ra;
    }
};

int main(){
    Solution S;

    vector<string> dk{"","","",""};
    
    S.suggestedProducts(dk, "");

    return 0;
}